import React from 'react';
import { useNavigate } from 'react-router-dom';

const AdminDashboard = () => {
  const navigate = useNavigate();

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-700 via-gray-900 to-black text-white p-8">
      <h1 className="text-4xl font-bold text-center mb-8">Admin Dashboard</h1>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {/* Placeholder Cards */}
        <div className="bg-gray-800 p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold mb-2">Total Users</h2>
          <p className="text-4xl font-bold">124</p>
        </div>

        <div className="bg-gray-800 p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold mb-2">Active Shipments</h2>
          <p className="text-4xl font-bold">56</p>
        </div>

        <div className="bg-gray-800 p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold mb-2">Pending Approvals</h2>
          <p className="text-4xl font-bold">8</p>
        </div>

        {/* Recent Activity Section */}
        <div className="bg-gray-800 p-6 rounded-lg shadow-md col-span-1 md:col-span-2">
          <h2 className="text-xl font-semibold mb-4">Recent Activity</h2>
          <ul className="list-disc pl-5 space-y-2">
            <li>User <span className="font-semibold">John Doe</span> registered.</li>
            <li>Shipment #23456 was updated.</li>
            <li>Admin <span className="font-semibold">Jane Smith</span> approved a company.</li>
          </ul>
        </div>

        {/* Companies Section */}
        <div className="bg-gray-800 p-6 rounded-lg shadow-md flex flex-col justify-between">
          <h2 className="text-xl font-semibold mb-4">Manage Companies</h2>
          <button
            onClick={() => navigate('/companies')}
            className="bg-blue-600 text-white py-2 px-4 rounded-lg shadow-md hover:bg-blue-700 transition"
          >
            Go to Companies List
          </button>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
